import React, { useState } from 'react';
import { connect } from 'react-redux';
import Grid from '@mui/material/Grid';
import { Avatar, Button, Paper, TextField, Typography } from '@mui/material';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import axios from 'axios';
import Alert from '@mui/material/Alert';
import { createDietList } from '../redux/actions/productActions';

const CreateDietList = (props) => {
  const { createDietList } = props;
  const [categoryId, setCategoryId] = useState('');
  const [categoryName, setCategoryName] = useState('');
  const [dietitianName, setDietitianName] = useState('');
  const [description, setDescription] = useState('');
  const [categoryImage, setCategoryImage] = useState('');
  const [allowedFoods, setAllowedFoods] = useState([]);
  const [productId, setProductId] = useState('');
  const [productName, setProductName] = useState('');
  const [proteinValue, setProteinValue] = useState('');
  const [productImage, setProductImage] = useState('');
  const [carbohydrateValue, setCarbohydrateValue] = useState('');
  const [oilValue, setOilValue] = useState('');
  const [glutenValue, setGlutenValue] = useState('');
  const [ketogenicDiet, setKetogenicDiet] = useState('');
  const [glutenFree, setGlutenFree] = useState('');
  const [saltFree, setSaltFree] = useState('');
  const [calorieValue, setCalorieValue] = useState('');
  const [forbiddenFoods, setForbiddenFoods] = useState([]);
  const [planId, setPlanId] = useState('');
  const [dailyDietPlan, setDailyDietPlan] = useState([]);
  const [ageRange, setAgeRange] = useState('');
  const [programDetails, setProgramDetails] = useState([]);
  const [breakfast, setBreakfast] = useState('');
  const [lunch, setLunch] = useState('');
  const [dinner, setDinner] = useState('');
  const [snack, setSnack] = useState('');
  const [amountOfWater, setAmountOfWater] = useState('');
  const [error, setError] = useState('');

  const isFormCompleted =
    categoryId &&
    categoryName &&
    dietitianName &&
    description &&
    categoryImage &&
    allowedFoods.length > 0 &&
    productId &&
    productName &&
    proteinValue &&
    productImage &&
    carbohydrateValue &&
    oilValue &&
    glutenValue &&
    ketogenicDiet &&
    glutenFree &&
    saltFree &&
    calorieValue &&
    forbiddenFoods.length > 0 &&
    dailyDietPlan.length > 0 &&
    planId &&
    ageRange &&
    programDetails.length > 0 &&
    breakfast &&
    lunch &&
    dinner &&
    snack &&
    amountOfWater;

  const fetchDietList = async () => {
    try {
      const resp = await axios.post('http://localhost:3001/dietCategory', {
        categoryId: categoryId,
        categoryName: categoryName,
        dietitianName: dietitianName,
        description: description,
        categoryImage: categoryImage,
        allowedFoods: allowedFoods,
        forbiddenFoods: forbiddenFoods,
        dailyDietPlan: dailyDietPlan,
      });

      if (resp.status === 200) {
        createDietList(resp.data);
        setError('');
      } else {
        setError('Error');
      }
    } catch (error) {
      console.log('Error:', error);
      setError('Error');
    }
  };

  return (
    <Grid container justifyContent="center">
      <Paper elevation={10} style={{ padding: 20, margin: '120px auto' }}>
        <Avatar style={{ backgroundColor: '#9c27b0' }}>
          <LockOutlinedIcon />
        </Avatar>
        <Typography variant="h5" align="center">
          Let's Create a Diet List
        </Typography>
        <Grid container direction="row" spacing={2}>
          <Grid item xs={6}>
            <Grid align="center">
              <Typography variant="h5">User Information</Typography>
            </Grid>
            <TextField
              label="Category Name"
              placeholder="Enter Category name"
              fullWidth
              required
              style={{ marginBottom: '15px' }}
              color="secondary"
              value={categoryName}
              onChange={(e) => setCategoryName(e.target.value)}
            />
            <TextField
              label="Dietitian Name"
              placeholder="Enter Dietitian name"
              fullWidth
              required
              style={{ marginBottom: '15px' }}
              color="secondary"
              value={dietitianName}
              onChange={(e) => setDietitianName(e.target.value)}
            />
            <TextField
              label="Description"
              placeholder="Enter Description"
              fullWidth
              required
              style={{ marginBottom: '15px' }}
              color="secondary"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
            />
            <TextField
              label="Category Image"
              placeholder="Enter Category image URL"
              fullWidth
              required
              style={{ marginBottom: '15px' }}
              color="secondary"
              value={categoryImage}
              onChange={(e) => setCategoryImage(e.target.value)}
            />
            {/* Add more TextField components for the remaining fields */}
          </Grid>
          <Grid item xs={6}>
            <Grid align="center">
              <Typography variant="h5">Let's Get to Know You</Typography>
            </Grid>
            {/* Add TextField components for the remaining fields */}
          </Grid>
        </Grid>
        <Button
          type="submit"
          color="secondary"
          variant="contained"
          disabled={!isFormCompleted}
          fullWidth
          style={{ margin: '8px 0' }}
          onClick={fetchDietList}
        >
          Create Diet List
        </Button>

        {error && (
          <Alert severity="error" style={{ marginBottom: '15px' }}>
            {error}
          </Alert>
        )}
      </Paper>
    </Grid>
  );
};

const mapStateToProps = (state) => ({});

const mapDispatchToProps = (dispatch) => {
  return {
    createDietList: (dietList) => dispatch(createDietList(dietList)),
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(CreateDietList);
